import React from "react";
import "./App.css";

function Tweet() {
  let likes = 0;

  const like = () => {
    likes++;
  };

  return (
    <div className="tweet">
      <h3>Name</h3>
      <p>This is a random tweet</p>
      <h3>Likes: {likes}</h3>
      <button onClick={like}>Like this message</button>
    </div>
  );
}

export default Tweet;
